function mail_setting(e) {
    var t = $("#" + e + "_email").val(),
        a = $("#" + e + "_veri_msg").val(),
        s = $("#" + e + "_forgot_msg").val(),
        n = $("#" + e + "_subject").val();
    "" == t
        ? error_msg("Enter E-Mail")
        : t.match(/^[\w\-\.\+]+\@[a-zA-Z0-9\.\-]+\.[a-zA-z0-9]{2,4}$/)
            ? "" == n
                ? error_msg("Enter subject")
                : "" == a
                    ? error_msg("Enter verification massage")
                    : "" == s
                        ? error_msg("Enter forgot password massage")
                        : $.ajax({
                            type: "POST",
                            url: "email_credentials",
                            data: new FormData($("#" + e + "_form")[0]),
                            contentType: !1,
                            processData: !1,
                            success: function (e) {
                                e.match("update") ? success_msg("Credentials Updated") : error_msg("Credentials not updated");
                            },
                        })
            : error_msg("Enter a valid email address");
}
